// src/components/Receipt.js
import React from 'react';

const Receipt = () => {
  return (
    <div>
        <nav id = "desktop-nav">
            <div class = "Name"> E -Wallet </div>
            <div>
                <ul class ="nav-links">
                    <li><a href = "#About"> About</a></li>
                    <li><a href = "#Movies"> Top 20 Movies</a></li>
                    <li><a href = "#Series"> Top 10 Series </a></li>
                    <li><a href = "#whoIsWatching"> Choose Account</a></li>
                    <li><a href = "#contact"> Contacts </a></li>
                </ul>
            </div>
        </nav>   
    </div>
  );
};

export default Receipt;
